// const mongoose = ('mongoose');
import mongoose, { Schema, model } from "mongoose"

const ProductScema = new Schema({
    name: {
        type: String
    },
    category: {
        type: String
    },
    image: [{
        title: { type: String }
    }],
    created: {
        type: Date,
        default: Date.now
    },
    updated: {
        type: Date,
        default: Date.now
    }
});

ProductScema.methods.toJSON = function () {
    var obj = this.toObject();
    delete obj.updated;
    return obj;
};

//Export user module
export default mongoose.models.Product || model('Product', ProductScema);
